if mibBuilder.loadTexts: docsIfMCmtsEqamDownstreamDevicePhyParamLock.setDescription("Indicates if by design the QAM Channel is directly configurable. This BIT set is derived from the dependency group a QAM channel belongs where docsIfMCmtsEqamGroupDependencyType is equal to docsPHYParamFixValue When a specific BIT is set to '1', the PHY parameter in docsIfMCmtsDepiSessionConfigTable is locked for SNMP SETs, returning 'notWritable' on SET attempts. When a specific BIT is set to '0', the PHY parameter in docsIfMCmtsDepiSessionConfigTable is processed. Note that when a BIT is set to '0' an SNMP SET as described above may affect the PHY parameter in other QAM channels as described in docsIfMCmtsEqamGroupDependencyTable or rejected with error 'wrongValue' based on the constrains indicated by the EQAM capabilities docsIfMCmtsEqamDownstreamCapabilitiesTable of DOCS-If-M-CMTS-MIB. This object contains information that is used to signal 'lock' PHY parameters to other entities via interfaces such as DEPI and ERMI.")
