if mibBuilder.loadTexts: docsIfMCmtsEqamDownstreamDeviceConfigPhyParamLock.setDescription("Administrative configuration of lock bits for EQAM channels PHY parameters. A BIT set of this object is meaningful when the same BIT set in docsIfMCmtsEqamDownstreamDevicePhyParamLock is set to '0'. Therefore, a SET to this object when the entry value of docsIfMCmtsEqamDownstreamDevicePhyParamLock is set to '1' returns error 'wrongValue'. When a PHY parameter BIT in this object is set to '1' the QAM channel PHY parameter in docsIfMCmtsDepiSessionConfigTable is locked for SNMP SETs returning error 'notWritable' on those attempts. Sets to this object could be complex; as a rule of thumb, SNMP agents ignore bits that are not recognized (e.g., extensions). An attempt to set BITs while docsIfMCmtsEqamDownstreamDeviceConfigPhyParamLock is set to '1' is rejected and the error code 'wrongValue' is returned.")
