if mibBuilder.loadTexts: docsIfMCmtsEqamDownstreamAllocationStatus.setDescription("Indicates the service(s) the M-CMTS Downstream Interface is allocated for. 'other' BIT set to '1' indicates the resource is currently allocated to DOCSIS and/or Video services by a proprietary mechanism. 'docsisDepi' BIT set to '1' indicates the DEPI Control mechanism is currently in use in the M-CMTS Downstream Interface allocation, e.g., an L2TPv3 DEPI Session. 'docsisErm' indicates that ERM Resource Allocation Interface is being used in the M-CMTS Downstream Interface allocation. 'video' indicates the resource is currently allocated by a video control plane using an extension of the M-CMTS ERM Resource Control Plane. All BITs set to zero or a zero-length octet string indicates the M-CMTS Downstream Interface is available for allocation constrained to the type of resource allocation referenced by docsIfMCmtsEqamDownstreamAllocationType. It may be the case where several BITs are set to '1' simultaneously: The most common case is 'docsisDepi' and 'docsisERM' BITs. In this situation, the ERM has allocated the QAM channel and the DEPI Session handles optional parameters configuration and/or in-band link status. Combinations like 'docsisDepi' and 'videoERM' may indicate concurrent services, which is vendor specific.")
