if mibBuilder.loadTexts: docsIfMCmtsEqamDownstreamAllocationTimeout.setStatus('current')
if mibBuilder.loadTexts: docsIfMCmtsEqamDownstreamAllocationTimeout.setDescription('Indicates the number of seconds the EQAM device waits before advertising the QAM channel resource is idle and/or accepting a session establishment from a different control plane to the previous one. As a side effect, the entry in docsIfMCmtsDepiSessionConfigTable is aged out and destroyed only after the expiration of this reservation timeout. A value zero makes the resource available immediately for allocation to others. Note that not explicit indefinite timeout needs to be defined to indicate exclusive allocation to a requester. The EQAM device can support this condition for example by configuring restricted access to certain Resource Allocation control plane to a particular IP host in the form of source IP or authentication mechanisms.')
docsIfMCmtsEqamDownstreamDRRPAdvertizing = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 6, 1, 3, 1, 1, 8), TruthValue().clone('true')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: docsIfMCmtsEqamDownstreamDRRPAdvertizing.setStatus('current')
if mibBuilder.loadTexts: docsIfMCmtsEqamDownstreamDRRPAdvertizing.setDescription("Indicates when a QAM channel resource should be advertised via DRRP (DOCSIS Resource Registration Protocol) to an Edge Resource Manager (ERM). This Object is useful when a device is allocated for instance to DOCSIS only by a static reservation (docsIfMCmtsEqamDownstreamAllocationType 'docsisOnly'). It means an Edge Resource Manager won't have this QAM channel resource available allocate upon requests from different entities. Note that DRRP currently does not signal EQAM resources as reserved for a particular service. The MIB objects docsIfMCmtsEqamDownstreamDRRPAdvertizing and docsIfMCmtsEqamDownstreamAllocationType are used primarily to statically reserve QAM channels and prevent its allocation by dynamic means such ERM or some other existing mechanisms. Therefore, caution is needed when setting this object to 'true' since the allocation Type docsIfMCmtsEqamDownstreamAllocationType is not known by ERMs with DRRP support.")
