if mibBuilder.loadTexts: docsIfMCmtsEqamDownstreamCapabInterleaver.setDescription("The QAM channel Interleaver capabilities. 'eqamDependency' BIT set to '1' indicates the QAM channel interleave value has dependencies with other QAM channels as indicated in docsIfMCmtsEqamGroupDependencyTable. 'taps8Increment16' set to '1' indicates the support of j = 8, i = 16 interleave. 'taps16Increment8' set to '1' indicates the support of j = 16, i = 8 interleave. 'taps32Increment4' set to '1' indicates the support of j = 32, i = 4 interleave. 'taps64Increment2' set to '1' indicates the support of j = 64, i = 2 interleave. 'taps128Increment1' set to '1' indicates the support of j = 128, i = 1 interleave. 'taps12increment17' set to '1' indicates the support of j = 12, i = 17 interleave. 'tabs128increment2' set to '1' indicates the support of j = 128, i = 2 interleave. 'tabs128increment3' set to '1' indicates the support of j = 128, i = 3 interleave. 'tabs128increment4' set to '1' indicates the support of j = 128, i = 4 interleave. 'tabs128increment5' set to '1' indicates the support of j = 128, i = 5 interleave. 'tabs128increment6' set to '1' indicates the support of j = 128, i = 6 interleave. 'tabs128increment7' set to '1' indicates the support of j = 128, i = 7 interleave. 'tabs128increment8' set to '1' indicates the support of j = 128, i = 8 interleave. When 'eqamDependency' BIT is set to '1', a set to the interleave PHY parameter of a QAM channels in a dependency group (with docsIfMCmtsEqamGroupDependencyType set to docsPHYParamSameValue), sets the same Interleave value to all QAM channels in the dependency group.")
