if mibBuilder.loadTexts: docsIfMCmtsEqamGroupDependencyPhyParam.setDescription("This object represents the type of DOCSIS PHY parameter that may have dependencies when setting an individual object in the dependency group. The value 'all' may be used as a wildcard to indicate all PHY parameters. The other enumeration values are DOCSIS PHY parameters. The opposite to 'all' is 'noDependencies', which indicates no dependencies in PHY parameters, but is only used to indicate no dependencies across all the EQAM device. Thus, when used, 'notDependencies' is accompanied by docsIfMCmtsEqamGroupDependencyPhysicalIndex '0' as the only entry in the table. In this way it is clearly distinguished when an EQAM device has dependencies instead of an empty table.")
