if mibBuilder.loadTexts: docsIfMCmtsEqamGlobCfgDownInterleave.setDescription("The object for global configuration of Downstream channel interleave of the QAM channels in the containment tree of docsIfMCmtsEqamGlobCfgDownPhysicalIndex. A set to this object is reflected in docsIfDownChannelInterleave of the QAM channels being set. Values are defined as follows: 64QAM/256QAM 'taps8Increment16' : protection 5.9/4.1 usec, latency .22/.15 msec 'taps16Increment8' : protection 12/8.2 usec, latency .48/.33 msec 'taps32Increment4' : protection 24/16 usec, latency .98/.68 msec 'taps64Increment2' : protection 47/33 usec, latency 2/1.4 msec 'taps128Increment1' : protection 95/66 usec, latency 4/2.8 msec 'taps12increment17' : protection 18/14 usec, latency 0.43/0.32 msec Values below are not defined for DOCSIS RFI MIB for docsIfDownChannelInterleave. The EQAM Channel supports these values for video services (see docsIfMCmtsEqamDownstreamCapabInterleaver specific EQAM supported values). 'tabs128increment2' : protection 190/132 usec, latency 8/5.6 msec 'tabs128increment3' : protection 285/198 usec, latency 12/8.4 msec 'tabs128increment4' : protection 379/264 usec, latency 16/11 msec 'tabs128increment5' : protection 474/330 usec, latency 20/14 msec 'tabs128increment6' : protection 569/396 usec, latency 24/17 msec 'tabs128increment7' : protection 664/462 usec, latency 28/19 msec 'tabs128increment8' : protection 759/528 usec, latency 32/22 msec Setting this object without setting docsIfMCmtsEqamGlogCfgDownAnnex may end up with particular QAM channels set rejections due to incompatible Annex parameters, in which case the error 'errorSetFailures' is reported in docsIfMCmtsEqamGlobCfgDownExecutionCode.")
