if mibBuilder.loadTexts: docsIfMCmtsEqamGlobCfgDownSymbolRateM.setDescription("The object for global configuration of Downstream channel Symbol M factor of the QAM channels in the containment tree of docsIfMCmtsEqamGlobCfgDownPhysicalIndex. When setting M and N Symbol Rate parameters, both docsIfMCmtsEqamGlobCfgDownSymbolRateM and docsIfMCmtsEqamGlobCfgDownSymbolRateN objects MUST be present in the entry, otherwise an error code 'notCommitted' is reported in docsIfMCmtsEqamGlobCfgDownExecutionCode of this entry. Setting this object without setting docsIfMCmtsEqamGlogCfgDownAnnex may end up with particular QAM channels set rejections due to incompatible Annex parameters, in which case the error 'errorSetFailures' is reported in docsIfMCmtsEqamGlobCfgDownExecutionCode.")
