if mibBuilder.loadTexts: docsIfMCmtsEqamGlobCfgDownLockParams.setDescription("The object for global configuration of Downstream channel lock state of the PHY parameters of the QAM channels in the containment tree of docsIfMCmtsEqamGlobCfgDownPhysicalIndex. A locked PHY parameter is blocked for sets via Management or other means such as DEPI session. Setting a BIT to '1' locks the corresponding PHY parameter for configuration, returning error 'wrongValue' on SET attempts until administratively unlocked. A set to this object is reflected in docsIfMCmtsEqamDownstreamDeviceConfigPhyParamLock of the QAM channels being set. Note that setting a BIT to '0' does not necessarily grant write access to a PHY parameter, because of existing hardware constraints indicated in docsIfMCmtsEqamDownstreamDevicePhyParamLock.")
docsIfMCmtsEqamGlobCfgDownExecutionCode = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 6, 1, 3, 4, 1, 12), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6, 7))).clone(namedValues=NamedValues(("complete", 1), ("errorNoPhysIndex", 2), ("errorNoQAMChannels", 3), ("errorSetFailures", 4), ("errorNoCommitted", 5), ("warningDependencies", 6), ("errorOther", 7)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: docsIfMCmtsEqamGlobCfgDownExecutionCode.setStatus('current')
if mibBuilder.loadTexts: docsIfMCmtsEqamGlobCfgDownExecutionCode.setDescription("Indicates the status of the global configuration entry execution. If different than 'none', represents the last error condition present. 'complete' indicates the Global configuration success with no errors. 'errorNoPhysIndex' indicates the value of docsIfMCmtsEqamGlobCfgDownPhysicalIndex does not exist. 'errorSetFailures' indicates the global set was commit but individual QAM channels reported errors on sets. The counter docsIfMCmtsEqamGlobCfgDownErrorCount is increased for each QAM channel set failure. 'errorNoCommitted' indicates the entry was not committed as sets to the associated QAM channels due to inconsistent PHY parameters. Few possible cases are: - refer to the docsIfMCmtsEqamGlogCfgDownAnnex constraints and related Annex objects as it describes. - setting an unique parameter with wrong syntax, leaving the entry in 'notReady' status See RowStatus Object description. 'warningDependencies' indicates the command was executed and the system may have detected dependencies. This execution code is optional and considered a warning rather than an error, as the management entity can have knowledge about group dependencies prior to setting an entry by inspecting docsIfMCmtsEqamGroupDependencyTable. 'errorOther' indicates an error condition not considered in the above situations. As multiple QAM channels are set only the last error condition is maintained in case of a no 'complete' execution status. A warning condition (e.g., 'warningDependencies' does not override an existing error condition (other enumeration values).")
