if mibBuilder.loadTexts: docsIfMCmtsEqamGlobCfgDownErrorsCount.setDescription('The number of error cases where a QAM channel was not successfully set. This value starts counting at zero any time the global configuration entry is executed. This object is reset back to zero in case of a successful set.')
