docsIfMCmtsChannelBlockTestType = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 6, 1, 3, 5, 1, 5), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6, 7))).clone(namedValues=NamedValues(("noTest", 1), ("offOthersNormal", 2), ("allOff", 3), ("onOthersOff", 4), ("cwOnOthersOff", 5), ("cwOnOthersNormal", 6), ("clockTest", 7)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: docsIfMCmtsChannelBlockTestType.setStatus('current')
if mibBuilder.loadTexts: docsIfMCmtsChannelBlockTestType.setDescription("A set of in-service and out-of-service test modes. The value 'noTest'(1) is the normal condition after reinitialization where the QAM channels are expected in operation. 'noTest' It is also used to take out of testing mode a QAM channel within the block. In-service tests modes: 'offOthersNormal' It is the condition where the QAM Channel indicated in docsIfMCmtsChannelBlockTestIfIndex has its carrier suppressed and the other channels in the Block Channel are operational. 'allOff' All QAM channels carriers in the channel block are Suppressed. 'onOthersOff' It is the condition where the QAM channel indicated in docsIfMCmtsChannelBlockTestIfIndex is in operation and the other QAM channels in the channel Block have their carriers suppressed. Out-of-service test modes: 'cwOnOthersOff' It is the condition where the QAM channel indicated in docsIfMCmtsChannelBlockTestIfIndex transmits a continuous wave (CW) while the other QAM channels in the channel Block have their carriers suppressed. 'cwOnOthersNormal' It is the condition where the QAM channel indicated in docsIfMCmtsChannelBlockTestIfIndex transmits a continuous wave (CW) while the other QAM channels in the channel Block are operational. 'clockTest' It is the condition where the QAM channel indicated in docsIfMCmtsChannelBlockTestIfIndex transmits a sequence of alternating -1 and 1 symbols. This object value does not persist after system Reinitialization. The value of this object is meaningless if docsIfMCmtsChannelBlockTestIfIndex is set to zero.")
