if mibBuilder.loadTexts: docsIfMCmtsDepiSessionConfigTSID.setDescription('The TSID to be associated to the DEPI Session. TSID is a 16-bit unsigned integer value configured per QAM channel in the EQAM device and serves as a QAM channel identifier at several network levels. When this object is set to 0, at the most the L2TPv3 Control Plane of the DEPI session is established but not DEPI L2TPv3 Session itself. It means, there might be the situations where the DEPI Control Plane already exists e.g., a different DEPI session to same EQAM device. In this case the new entry will no trigger the DEPI Control Plane creation. The TSID value zero may accomplish functions like testing of DEPI Control Plane connectivity without launching the DEPI Session itself; DLM over a M-CMTS Core - EQAM devices path with no Active sessions for administrative purposes.')
