if mibBuilder.loadTexts: docsIfMCmtsDepiRsrcAllocTable.setStatus('current')
if mibBuilder.loadTexts: docsIfMCmtsDepiRsrcAllocTable.setDescription('A table containing PHBIDs Resources used for DEPI applications. At the M-CMTS core these entries contain information about the mapping of egress traffic to PHIDs and DEPI flow IDs also known as DEPI payload encapsulation. For the M-CMTS Core there are two type of entries: o One set of entries is a preconfigured list of PHBIDs used for M-CMTS requests to EQAM IP Host, e.g., the MIB object docsIfMCmtsDepiSessionConfigRsrcAllocReq references those type of entry sets. In those entries the values of docsIfMCmtsDepiRsrcAllocUdpPort, docsIfMCmtsDepiRsrcAllocFlowId and docsIfMCmtsDepiRsrcAllocPolicyScnTags are ignored by the M-CMTS. o The second set of entries has the responses from the EQAM IP host to the M-CMTS when the DEPI session request is successful. The object docsIfMCmtsDepiSessionConfigPhbIdResp in docsIfMCmtsDepiSessionConfigTable references an entry of this type. The EQAM MAY implement this table to configure the different queue prioritization of the DEPI flow IDs, PHBIDs and UDP ports triplet used in the DEPI Resource allocation response to the M-CMTS. If this table is not implemented by the EQAM device the object docsIfMCmtsDepiSessionInfoRsrcAllocResp is set to zero, and the DEPI session Resource Allocation response is vendor specific. Also the EQAM device MAY implement this table as read-only for the purpose of debugging the DEPI Resource Allocation Responses sent to the M-CMTS core.')
docsIfMCmtsDepiRsrcAllocEntry = MibTableRow((1, 3, 6, 1, 4, 1, 4491, 2, 1, 6, 1, 4, 1, 3, 1), ).setIndexNames((0, "DOCS-IF-M-CMTS-MIB", "docsIfMCmtsDepiRsrcAllocIndex"), (0, "DOCS-IF-M-CMTS-MIB", "docsIfMCmtsDepiRsrcAllocSeq"))
if mibBuilder.loadTexts: docsIfMCmtsDepiRsrcAllocEntry.setStatus('current')
if mibBuilder.loadTexts: docsIfMCmtsDepiRsrcAllocEntry.setDescription('A conceptual row for this table. At minimum two entries for docsIfMCmtsDepiRsrcAllocSeq (two Flow ID entries) per docsIfMCmtsDepiRsrcAllocIndex value are needed for DEPI PSP mode. When the docsIfMCmtsDepiRsrcAllocIndex is used for DMPT mode one flow Id entry value is required. The PHBIDs contained in this entry are expanded with the tags of docsIfMCmtsDepiRsrcAllocPolicySCNTags to indicate the association of PSP packets attributes such as DOCSIS MAPS, DOCSIS MAC messages and DOCSIS Service Flows to a DEPI Flow ID. Thus, the EQAM IP Host uses those DEPI flow IDs to prioritize the QAM channel traffic.')
docsIfMCmtsDepiRsrcAllocIndex = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 6, 1, 4, 1, 3, 1, 1), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 4294967295)))
