docsIfMCmtsDepiRsrcAllocSeq = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 6, 1, 4, 1, 3, 1, 2), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 4294967295)))
if mibBuilder.loadTexts: docsIfMCmtsDepiRsrcAllocSeq.setStatus('current')
if mibBuilder.loadTexts: docsIfMCmtsDepiRsrcAllocSeq.setDescription('The sequence index for entries within the same docsIfMCmtsDepiRsrcAllocIndex value. EQAM IP Host may reply with less PHBIDs than requested, then, the M-CMTS Core skips the sequence index of missing PHBIDs when creating the Resource Allocation entry response. As a rule of thumb this object has the minimal queuing priority information for DEPI flows treatment in the EQAM. The lowest sequence value indicates the DEPI Flow ID with the highest priority treatment at the EQAM (e.g., DOCSIS MAC messages should be allocated to that flow) and the highest sequence number indicates the DEPI Flow ID with the lowest priority.')
