docsIfMCmtsDepiRsrcAllocPolicyScnTags = MibTableColumn((1, 3, 6, 1, 4, 1, 4491, 2, 1, 6, 1, 4, 1, 3, 1, 6), SnmpTagValue()).setMaxAccess("readcreate")
if mibBuilder.loadTexts: docsIfMCmtsDepiRsrcAllocPolicyScnTags.setStatus('current')
if mibBuilder.loadTexts: docsIfMCmtsDepiRsrcAllocPolicyScnTags.setDescription('A list of Service Class Names (SCN) tags associated to PHBID/Flow IDs. The policies associated to each DEPI Flow ID of this table allow the mapping of specific DOCSIS Service Flows well distinguished by SCN. The SCN encoding does not include the null terminated octets as DOCSIS specify for other configuration mechanisms such as Cable Modem config files encoding. This object is applicable to M-CMTS core but not to EQAM devices. In D-MPT mode no tags are needed since all DOCSIS traffic is mapped to same DEPI Flow ID, thus this object is set to zero-length string (no tag) or ignored. In PSP mode DOCSIS MAPS, DOCSIS MAC messages and PacketCable 1.0/1.5 voice traffic are mapped to the highest priority DEPI Flow ID (lower sequence number in the Resource allocation response) If this object is empty (no tag), the default policy is used. In PSP mode the default policy consists to assign the DEPI Flow ID of the lowest priority (highest sequence number) to the DOCSIS traffic. DOCSIS Traffic not matched to a policy Tag is mapped to the default policy Flow ID. In PSP mode the docsIfMCmtsDepiRsrcAllocSeq values pointed in a M-CMTS Core Resource Allocation Request has the preconfigured Policy Tags to map DOCSIS traffic to DEPI Flow IDs. When the Resource Allocation response from the EQAM is received, it could have same or less of the PHBIDs requested, and the PHBID references could be in a different order sequence. Therefore, the M-CMTS Core MUST accommodate the policy Tags initial configuration to the EQAM order sequence and number of PHBIDs. For example: A Resource Allocation Request: Seq Num PHBID Flow ID UDP Port Policy Tags -------- ------ -------- --------- ------------ 1 EF VoiceGold* 2 AF VideoConference 3 BE empty - no tag - * - PCMM voice service based on SCN, no PacketCable 1.0/1.5 voice The EQAM Resource Allocation response: Seq Num PHBID Flow ID UDP Port Policy Tags -------- ------ -------- --------- ------------ 1 EF 6 50201 2 BE 7 50202 It is vendor specific to re-allocate the policy Tags in the case of less DEPI Flow IDs in the Resource Allocation response than in the requests. In the example PHBID AF policy tag could be assigned to either Flow ID 6 or 7 Final Resource Allocation Tag reordering Seq Num PHBID Flow ID UDP Port Policy Tags -------- ------ -------- --------- ------------ 1 EF 6 50201 VoiceGold VideoConference 2 BE 7 50202 empty - no tag - Change of sequence in the response example: A Resource Allocation Request: Seq Num PHBID Flow ID UDP Port Policy Tags -------- ------ -------- --------- ------------ 1 0x30 VoiceGold 2 0x20 VideoConference 3 0x10 empty - no tag - * - PCMM voice service based on SCN, no PacketCable 1.0/1.5 voice The EQAM Resource Allocation response: Seq Num PHBID Flow ID UDP Port Policy Tags -------- ------ -------- --------- ------------ 1 0x20 6 50201 2 0x10 7 50202 3 0x30 8 50203 Final Resource Allocation Tag reordering Seq Num PHBID Flow ID UDP Port Policy Tags -------- ------ -------- --------- ------------ 1 0x20 6 50201 VoiceGold 2 0x10 7 50202 VideoConference 3 0x30 8 50203 empty - no tag -')
